import * as React from 'react';
import { View, Text, Image } from 'react-native';

export default function Akun({ navigation }) {
    return (
        <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
            
          <View style={{ backgroundColor:"#99A3D2" }}/>
        </View>
    );
}
